import React from 'react';
import {Header, Segment } from 'semantic-ui-react';

const SiteHeader = () => (

            <Segment clearing>
                <Header as='h3' floated='left'>
                    Charlie Leopard
                </Header>
                <Header as='h4' floated='right'>
                    Home
                </Header>
            </Segment>

    
)

export default SiteHeader;
